Os árabes são um grupo étnico semita, nativo principalmente do Oriente Médio e da África setentrional, originário da península Arábica, a qual é constituída majoritariamente por regiões desérticas. As dificuldades de plantio e criação de animais fizeram com que parte de seus habitantes se tornasse nômade, vagando pelo deserto em caravanas em busca de água e de melhores condições de vida. A essas tribos do deserto, dá-se o nome de beduínos. Existem três fatores que podem ajudar, em graus diversos, a determinar se um indivíduo é considerado árabe ou não: 
* políticos: se ele vive em um país membro da Liga Árabe (ou, de maneira geral, no mundo árabe); essa definição cobre mais de trezentos milhões de pessoas; 
* linguísticos: se sua língua materna é o árabe; essa definição cobre mais de duzentos milhões de pessoas; 
* genealógicos: pode-se traçar sua ascendência até os habitantes originais da península arábica. A importância relativa desses fatores é estimada diferentemente por diferentes grupos. Muitas pessoas que se consideram árabes o fazem com base na sobreposição da definição política e linguística, mas alguns membros de grupos que preenchem os dois critérios rejeitam essa identidade com base na definição genealógica. Não há muitas pessoas que se consideram árabes com base na definição política sem a linguística — assim, os curdos ou os berberes, geralmente, se identificam como não árabes — mas alguns sim: por exemplo, alguns Berberes consideram-se Árabes, e nacionalistas árabes consideram os Curdos como Árabes.
